import React from "react";
import spinner from "client/budget-app/src/img/Blocks-1s-200px.gif";
export default () => {
  return (
    <div>
      <img
        src={spinner}
        style={{ width: "100px", margin: "auto", display: "block" }}
        alt="Loading..."
      />
    </div>
  );
};
